function Signup () {
    const [username, setusername] = useState('')
    const [password, setpassword] = useState('')
    const [passwordconfirm, setpasswordconfirm] = useState('')

    //Use this to display error message
    const[registerstatus, setregisterstatus] = useState('')


    const Signup = () => {
        Axios.post('http://localhost:5000/rest/register', {
        username: username, 
        password: password,
        passwordconfirm: passwordconfirm
        }).then((response)=> {
            if(response.data.message)
            {
                setregisterstatus(response.data.message);
            }

            else
            {
                setregisterstatus(response.data[0]);
            }

        }).catch((error) => console.log(error));
    };

     return (  
        <div>
            <b>Create an Account</b>
            <br/>
            <b>Join our community</b>
            <br/>
            <br/>
            <form method="POST" action="/rest/register">
                <table border="0">
                    <tbody>
                        <tr>
                            <td>username:</td>
                            <td>
                                <input type="name" name="username" size="20" autocorrect="off" spellcheck="false"
                                       autocapitalize="off" value={username} onChange={(e)=> {setusername(e.target.value)}}/>
                            </td>
                        </tr>
                        <tr>
                            <td>Password:</td>
                            <td>
                                <input type="password" name="password" size="20" autocorrect="off" spellcheck="false"
                                       autocapitalize="off" value={password} onChange={(e)=> {setpassword(e.target.value)}}/>
                            </td>
                        </tr>
                        <tr>
                            <td>passwordconfirm:</td>
                            <td>
                                <input type="password" name="passwordconfirm" size="20" autocorrect="off" spellcheck="false"
                                       autocapitalize="off" value={passwordconfirm} onChange={(e)=> {setpasswordconfirm(e.target.value)}}/>
                            </td>
                        </tr>
                    </tbody>
                </table>
                <br/>
                <button onClick={Signup}> Submit </button>
                <div>
                Already have an account? 
                    <a href="/login"> Log in Here!</a>
                </div>
            </form>
            <div> <h1>{registerstatus}</h1></div>
        </div>

        );
}

export default Signup;
